impl Solution {
  pub fn xor_beauty(nums: Vec<i32>) -> i32 {
    nums.iter().fold(0, |xor, v| xor ^ v)
  }

  pub fn xor_beauty2(nums: Vec<i32>) -> i32 {
    let mut ones: Vec<i32> = vec![0; 32];

    nums.iter().for_each(|&v| {
      let mut n = v;
      (0..31).for_each(|ii| {
        ones[ii] += n % 2;
        n /= 2;
      });
    });

    let mut ans: i32 = 0;
    (0..31).rev().for_each(|idx| {
      ans = ans * 2 + ones[idx] % 2;
    });

    ans
  }
}

